import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>环签名隐私系统</h1>
        <p>基于区块链的高级隐私保护解决方案</p>
        <div className="button-container">
          <button className="app-button primary">根账户管理</button>
          <button className="app-button secondary">影子账户管理</button>
        </div>
      </header>
    </div>
  );
}

export default App;
